import React from 'react';
import Navbar from './Navbar';


function Home() {

    return (
        <div>
            <Navbar />
            <div className='container mt-5'>
                <div className='row'>
                    <div className='col-4'>
                        <div className='card'>
                            <div className='card-body'>
                                Naman
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
